import React from "react";
import gql from "graphql-tag";
import {graphql} from "react-apollo";

const products = gql`
query NewQuery {
  products {
    edges {
      node {
        id
        name
        onSale
        slug
        sku
        reviews {
          averageRating
          nodes {
            content
            date
            approved
          }
        }
      }
    }
  }
}`

const App = () => {
  return (
    <div>App</div>
  )
